css:
.sheet-toolbar {
  border-bottom: 1px solid #2c2c2c;
  box-shadow: none;
}
.thread-icon:not(.thread-icon-unread):not(.thread-icon-star) {
  filter: invert(100%);
}
img.content-dark {
  filter: invert(100%);
}
img.content-light {
  filter: invert(100%);
}
.mail-label {
  filter: contrast(110%) brightness(85%);
}
#message-list .message-item-wrap .message-item-white-wrap {
  box-shadow: 0 0 0.5px rgba(255, 255, 255, 0.28), 0 1px 1.5px rgba(255, 255, 255, 0.08);
}
.thread-list .list-item:not(.unread):not(.selected):not(.focused) {
  color: #aaa;
}
.thread-list .list-item.thread-list-reminder-item {
  background-color: #312856;
}
.thread-list .list-item.thread-list-reminder-item.unread {
  background-color: #312856;
}
.thread-list .list-item.thread-list-reminder-item.unread:not(.focused):not(.selected) {
  background-color: #312856;
}
.send-reminders-header {
  color: #7d5bef;
  background: #312856;
  border-bottom: 1px solid #4d3b8a;
}
.item-count-box {
  min-width: 15px;
  height: 15px;
  text-align: center;
  display: inline;
  font-size: 10.5px;
  padding: 0 0.286em 0 0.286em;
  line-height: 15px;
  border-radius: 2px;
  align-self: center;
}
body.platform-win32 .item-count-box {
  border-radius: 0;
}
.windows-btn-bg {
  transition: background 300ms, box-shadow 300ms;
  background: transparent;
  border-radius: 0;
}
.windows-btn-bg:hover {
  background: rgba(44, 44, 44, 0.8);
}
.windows-btn-border {
  border: 0;
  box-shadow: 0 0 0 2px rgba(44, 44, 44, 0.8);
}
.open-tracking-icon img {
  vertical-align: initial;
}
.open-tracking-icon img.content-mask.unopened {
  background-color: rgba(124, 25, 204, 0.2);
  cursor: default;
}
.open-tracking-icon img.content-mask.opened {
  background-color: #7c19cc;
  cursor: pointer;
}
.list-item.focused .open-tracking-icon img.content-mask.unopened,
.list-item.selected .open-tracking-icon img.content-mask.unopened {
  background-color: rgba(255, 255, 255, 0.3);
}
.list-item.focused .open-tracking-icon img.content-mask.opened,
.list-item.selected .open-tracking-icon img.content-mask.opened {
  background-color: white;
}
.open-tracking-icon .open-count {
  display: inline-block;
  position: relative;
  left: -16px;
  text-align: center;
  background-color: #58b660;
  font-size: 12px;
  font-weight: bold;
}
.open-tracking-icon {
  width: 15px;
  margin: 0 2px;
}
.open-tracking-message-status {
  color: rgba(238, 238, 238, 0.6);
  margin-left: 10px;
}
.open-tracking-message-status.unopened img.content-mask {
  background-color: rgba(238, 238, 238, 0.6);
}
.open-tracking-message-status.opened {
  cursor: pointer;
}
.open-tracking-message-status.opened img.content-mask {
  background-color: #7c19cc;
}
.open-tracking-message-popover {
  width: 250px;
  max-height: 240px;
}
.open-tracking-message-popover .open-tracking-header {
  padding: 5px 12px 0 12px;
  text-align: center;
  color: rgba(238, 238, 238, 0.8);
  font-weight: 600;
}
.open-tracking-message-popover .open-history-container {
  max-height: 216px;
  padding: 0 12px 5px 12px;
  overflow: auto;
}
.open-tracking-message-popover .open-history-container .open-action {
  color: rgba(238, 238, 238, 0.8);
}
.open-tracking-message-popover .open-history-container .open-action .recipient {
  text-overflow: ellipsis;
  overflow: hidden;
}
.open-tracking-message-popover .open-history-container .open-action .spacer {
  flex: 1 1 0;
}
.open-tracking-message-popover .open-history-container .open-action .timestamp {
  color: rgba(238, 238, 238, 0.6);
  flex-shrink: 0;
}
